-- ----------------------------
-- Table structure for `transactions`
-- ----------------------------
DROP TABLE IF EXISTS `transactions`;
CREATE TABLE `transactions` (
`id`  int(11) UNSIGNED NOT NULL AUTO_INCREMENT ,
`url`  char(36) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' ,
`info_id`  int(11) UNSIGNED NOT NULL ,
`account_id`  int(11) UNSIGNED NOT NULL ,
`user_id`  int(11) UNSIGNED NOT NULL COMMENT 'user who initiated the transfer' ,
`transfer_type`  enum('incoming','outgoing') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`transfer_id`  int(11) UNSIGNED NOT NULL ,
`outgoing_id`  int(11) UNSIGNED NULL DEFAULT NULL ,
`incoming_id`  int(11) UNSIGNED NULL DEFAULT NULL ,
`operation`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`type`  enum('positive','negative') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '1 - positive, 2 - negative' ,
`amount`  double UNSIGNED NOT NULL ,
`acc_balance`  float UNSIGNED NOT NULL ,
`created_at`  int(11) NOT NULL ,
PRIMARY KEY (`id`),
FOREIGN KEY (`info_id`) REFERENCES `transactions_info` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`account_id`) REFERENCES `accounts` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
FOREIGN KEY (`incoming_id`) REFERENCES `transfers_incoming` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
FOREIGN KEY (`outgoing_id`) REFERENCES `transfers_outgoing` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
INDEX `account_id` USING BTREE (`account_id`) ,
INDEX `transfer_id` USING BTREE (`transfer_id`) ,
INDEX `fk_transactions_user` USING BTREE (`user_id`) ,
INDEX `fk_outgoing_transfer` USING BTREE (`outgoing_id`) ,
INDEX `fk_incoming_transfer` USING BTREE (`incoming_id`) ,
INDEX `fk_info` USING BTREE (`info_id`) 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=14

;

