DROP TABLE IF EXISTS `users_deleted`;
CREATE TABLE `users_deleted` (
`id`  int(11) NOT NULL ,
`login`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`first_name`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`last_name`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`password`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`role`  int(2) NOT NULL ,
`email`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`status`  int(1) NOT NULL ,
`created_at`  int(11) NOT NULL ,
`updated_at`  int(11) NOT NULL ,
`hash`  varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`phone`  bigint(19) NOT NULL ,
`lang`  enum('en','ch','du','ge','fr','ru') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
PRIMARY KEY (`id`),
UNIQUE INDEX `phone` USING BTREE (`phone`) ,
UNIQUE INDEX `email` USING BTREE (`email`) 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci

