-- ----------------------------
-- Table structure for `users_files`
-- ----------------------------
DROP TABLE IF EXISTS `users_files`;
CREATE TABLE `users_files` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`user_id`  int(11) UNSIGNED NOT NULL ,
`name`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`ext`  varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`user_file_name`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`form`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`model_id`  int(11) NOT NULL ,
`document`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`deleted`  tinyint(1) NOT NULL DEFAULT 0 ,
`document_type`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`description`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`created_at`  int(11) NOT NULL ,
`updated_at`  int(11) NOT NULL ,
PRIMARY KEY (`id`),
FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
INDEX `fk_files_user` USING BTREE (`user_id`) 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=290

;

