-- ----------------------------
-- Table structure for `users_notification`
-- ----------------------------
DROP TABLE IF EXISTS `users_notification`;
CREATE TABLE `users_notification` (
`id`  int(11) NOT NULL AUTO_INCREMENT ,
`user_id`  int(11) UNSIGNED NOT NULL ,
`code`  varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`message`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`type`  enum('close','critical') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`closed`  tinyint(1) NOT NULL DEFAULT 0 ,
`style`  enum('green','yellow','red') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
PRIMARY KEY (`id`),
FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
INDEX `user_id` USING BTREE (`user_id`) 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=115

;

